  <>
    <Head title="Page title" description="Add desc" />
    <Header />
    <main className={"flex-grow flex items-center justify-center bg-gray-100"}>
      <div className={"container h-full mx-auto py-16 " + props.className}>
        {props.children}
      </div>
    </main>
    <Footer />
  </>
);

export default Page;
